import React, { useState } from "react";

function Track(props) {
  console.log(props);

  return (
    <div>
      <p>
        {props.info.artist} - {props.info.name}
      </p>
      <p>{props.info.album}</p>
      <input
        type="checkbox"
        taskDone={props.updater}
        onChange={handleChange}
      ></input>
    </div>
  );
}

export default Track;
